window.bookSummaryJSON = "<p>What is the difference between ignorance and stupidity? Ignorance can be solved if you live long enough.</p> <p>Zaena has been sent as an Elven emissary to learn and build a relationship with humanity. She's only two hundred and fifty years old, so time should be on her side. Except she gets involved in a brutal gang war in the first month of landing on the shores of the West Coast of the United States.</p> <p>San Francisco, to be exact.</p> <p>Zaena quickly learns that her knowledge of humanity is closer to the twentieth than the present-day twenty-first century.</p> <p>So much for her teachers' study of humanity's television shows.</p> <p>She's got attitude, magic, and a sacred armor pendant. What she doesn't have is a clue.</p> <p>She will survive her ignorance or die trying to build a bridge and save her people.</p>"; 
